import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        { name: 'Dracula' },
        { name: 'Teja;' },
        { name: 'Abhishel' },
      ]
    }
  }
  render() {
    return (
      <div className="App">
        {
          this.state.monsters.map(monsters => {
            return (<div>{monsters.name}</div>)
          })
        }
        <p>Shubhangi Ambade</p>
      </div>
    );
  }
}

export default App;
